CREATE DATABASE sellective;

USE sellective;

CREATE TABLE IF NOT EXISTS Buyers(
    buyerId int PRIMARY KEY AUTO_INCREMENT,
    firstName varchar(40),
    lastName varchar(40),
    email varchar(50) UNIQUE,
    phone varchar(15) UNIQUE,
    street varchar(40),
    city varchar(40),
    state varchar(40),
    zip varchar(40)
);

CREATE TABLE IF NOT EXISTS Sellers (
    sellerId int PRIMARY KEY AUTO_INCREMENT,
    firstName varchar(40),
    lastName varchar(40),
    email varchar(50) UNIQUE,
    phone varchar(15) UNIQUE,
    street varchar(40),
    city varchar(40),
    state varchar(40),
    zip varchar(40)
);

CREATE TABLE IF NOT EXISTS ProductCategories(
    categoryId int PRIMARY KEY AUTO_INCREMENT,
    categoryName varchar(40)
);

CREATE TABLE IF NOT EXISTS Authenticators (
    authenticatorId int PRIMARY KEY AUTO_INCREMENT,
    firstName varchar(40),
    lastName varchar(40),
    email varchar(50) UNIQUE,
    phone varchar(15) UNIQUE,
    street varchar(40),
    city varchar(40),
    state varchar(40),
    zip varchar(40)
);

CREATE TABLE IF NOT EXISTS Products(
    productId int PRIMARY KEY AUTO_INCREMENT,
    name varchar(100),
    categoryId int,
    CONSTRAINT productCategories
        FOREIGN KEY (categoryId) references ProductCategories (categoryId)
            ON DELETE RESTRICT
);



CREATE TABLE IF NOT EXISTS Listings(
    listingId int PRIMARY KEY AUTO_INCREMENT,
    timeListed DATETIME DEFAULT CURRENT_TIMESTAMP,
    quantity int,
    price decimal(10,2),
    title text,
    description text,
    sellerId int,
    productId int
);

ALTER TABLE Listings
ADD FOREIGN KEY (sellerId) references Sellers (sellerId),
ADD FOREIGN KEY (productId) references Products (productId);

CREATE TABLE IF NOT EXISTS Orders (
    orderId int PRIMARY KEY AUTO_INCREMENT,
    amountPaid decimal(10,2),
    completed boolean,
    dateShipped DATE,
    quantity int,
    buyerId int,
    sellerId int,
    authenticatorID int,
    listingID int,
    isAuthenticated boolean,
    FOREIGN KEY (buyerId) references Buyers (buyerId),
    FOREIGN KEY (sellerId) references Sellers (sellerId),
    FOREIGN KEY (authenticatorId) references Authenticators (authenticatorId),
    FOREIGN KEY (listingId) references Listings (listingId)
        ON DELETE CASCADE
);


CREATE TABLE IF NOT EXISTS ListingReviews(
    reviewId int PRIMARY KEY AUTO_INCREMENT,
    likes int,
    dislikes int,
    timePosted DATETIME DEFAULT CURRENT_TIMESTAMP,
    reviewComment text,
    buyerId int,
    listingId int,
    FOREIGN KEY (buyerId) references Buyers (buyerId),
    FOREIGN KEY (listingId) references Listings (listingId)
        ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS ListingReviewResponses (
    responseId int PRIMARY KEY AUTO_INCREMENT,
    responseComment text,
    timePosted DATETIME DEFAULT CURRENT_TIMESTAMP,
    reviewID int,
    FOREIGN KEY (reviewId) references ListingReviews (reviewId)
        ON DELETE CASCADE

);

CREATE TABLE IF NOT EXISTS AuthenticatorListingNotes(
    noteID int PRIMARY KEY AUTO_INCREMENT,
    noteComment text,
    timePosted DATETIME DEFAULT CURRENT_TIMESTAMP,
    listingId int,
    authenticatorId int,
    FOREIGN KEY (listingId) references Listings (listingId)
        ON DELETE CASCADE,
    FOREIGN KEY (authenticatorId) references Authenticators (authenticatorId)
        ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS SellerReviews (
    reviewId int PRIMARY KEY AUTO_INCREMENT,
    likes int,
    dislikes int,
    timePosted DATETIME DEFAULT CURRENT_TIMESTAMP,
    reviewComment text,
    buyerId int,
    sellerId int,
    FOREIGN KEY (buyerId) references Buyers (buyerID),
    FOREIGN KEY (sellerID) references Sellers (sellerId)
        ON DELETE CASCADE
);


CREATE TABLE IF NOT EXISTS SellerReviewResponses(
    responseId int PRIMARY KEY AUTO_INCREMENT,
    responseComment text,
    timePosted DATETIME DEFAULT CURRENT_TIMESTAMP,
    reviewId int,
    FOREIGN KEY (reviewId) references SellerReviews (reviewId)
        ON DELETE CASCADE
);

